import "./NavBar.css";
const NavBar = () => {
  return (
    <div className="container">
      <div className="navBar">
        <h1 id="navTitle">Herolo Weather Task</h1>
        <ul className="navItems">
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Favorites</a>
          </li>
        </ul>
      </div>
    </div>
  );
};
export default NavBar;
